import { Route, Switch } from "react-router-dom";

import App from "./App";
import Statistics from "./components/Statistics/Statistics";

const Routes = () => (
  <Switch>
    <Route path="/" exact component={App} />
    <Route path="/statistics" exact component={Statistics} />
  </Switch>
);

export default Routes;
